import React from "react";
import Hero from "../components/Hero";
import HomeImg from "../images/12.jpg";

export default function Home() {
    return (
      <div className="home">
        <Hero
          className="hero"
          img={HomeImg}
          title="Your Journey Your Story"
          text="Choose Your Favourite Destination"
          btnUrl=""
        />
      </div>
    );
}
